import React, { useState, useEffect } from 'react';
import { productAPI } from '../services/api';
import './ProductList.css';

const ProductList = () => {
  const [products, setProducts] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    fetchProducts();
  }, []);

  const fetchProducts = async () => {
    try {
      // ✅ Use correct API function name (should exist in api.js)
      const response = await productAPI.getFarmerProducts();
      console.log('Products fetched:', response.data);
      setProducts(response.data);
      setError('');
    } catch (err) {
      console.error('Fetch products error:', err);

      // ✅ Extract readable error message
      let message =
        err.response?.data?.error ||
        err.response?.data?.message ||
        err.message ||
        'Failed to fetch products';

      // ✅ Set human-readable error text only
      setError(`Error fetching products: ${message}`);
    } finally {
      setLoading(false);
    }
  };

  const getImageUrl = (imagePath) => {
    if (!imagePath) return null;

    if (imagePath.startsWith('http')) return imagePath;
    if (imagePath.startsWith('/uploads/')) {
      return `http://localhost:8080${imagePath}`;
    }

    return `http://localhost:8080/uploads/${imagePath}`;
  };

  const refreshProducts = () => {
    setLoading(true);
    fetchProducts();
  };

  if (loading) return <div className="loading">Loading products...</div>;

  // ✅ Render only string, not object
  if (error)
    return (
      <div className="error-message">
        {typeof error === 'string' ? error : JSON.stringify(error)}
      </div>
    );

  return (
    <div className="product-list-container">
      <div className="product-list-header">
        <h2>View Product List</h2>
        <button className="refresh-btn" onClick={refreshProducts}>
          Refresh
        </button>
      </div>

      {products.length === 0 ? (
        <div className="no-products">
          <p>No products added yet.</p>
          <p>Add your first product using the form!</p>
        </div>
      ) : (
        <div className="products-grid">
          {products.map((product) => {
            const imageUrl = getImageUrl(product.imagePath);
            return (
              <div key={product.id} className="product-card">
                <div className="product-image-container">
                  {imageUrl ? (
                    <img
                      src={imageUrl}
                      alt={product.name}
                      className="product-image"
                      onError={(e) => {
                        console.error(`Failed to load image: ${imageUrl}`);
                        e.target.style.display = 'none';
                        e.target.nextSibling.style.display = 'flex';
                      }}
                    />
                  ) : null}
                  <div className={`image-placeholder ${imageUrl ? 'hidden' : ''}`}>
                    <span>No Photo</span>
                  </div>
                </div>

                <div className="product-info">
                  <h3 className="product-name">{product.name}</h3>
                  <div className="product-details">
                    <div className="detail-row">
                      <span className="detail-label">Category:</span>
                      <span className="detail-value">{product.category}</span>
                    </div>
                    <div className="detail-row">
                      <span className="detail-label">Price:</span>
                      <span className="detail-value price">₹{product.price}</span>
                    </div>
                    <div className="detail-row">
                      <span className="detail-label">Batch No:</span>
                      <span className="detail-value">{product.batchNumber}</span>
                    </div>
                    <div className="detail-row">
                      <span className="detail-label">Production:</span>
                      <span className="detail-value">
                        {new Date(product.productionDate).toLocaleDateString()}
                      </span>
                    </div>
                    {product.description && (
                      <div className="detail-row description-row">
                        <span className="detail-label">Description:</span>
                        <span className="detail-value description">{product.description}</span>
                      </div>
                    )}
                    <div className="detail-row">
                      <span className="detail-label">Added:</span>
                      <span className="detail-value">
                        {new Date(product.createdAt).toLocaleDateString()}
                      </span>
                    </div>
                  </div>
                </div>
              </div>
            );
          })}
        </div>
      )}
    </div>
  );
};

export default ProductList;
